import React from 'react';
import './ResultsScreen.css';

import homeIcon from '../assets/home_icon.png';
import restartIcon from '../assets/restart_icon.png';
import addIcon from '../assets/add_icon.png';

const ResultsScreen = ({ onBackToMenu }) => {
    // Mock Data based on the provided image
    // Expanded Mock Data
    const allPlayers = [
        { rank: '1st', name: 'Monster18', score: 4800, words: 15 },
        { rank: '2nd', name: 'CryptoCat', score: 4500, words: 14 },
        { rank: '3rd', name: 'Metil', score: 4200, words: 13 },
        { rank: '4th', name: 'Anhelink', score: 4000, words: 12 },
        { rank: '5th', name: 'Nooxin', score: 3800, words: 11 },
        { rank: '6th', name: 'D1ol', score: 3600, words: 10 },
        { rank: '7th', name: 'Crouton.hl', score: 3400, words: 9 },
        { rank: '8th', name: 'RevengelP', score: 3200, words: 8 },
        { rank: '9th', name: 'Pa3gBa', score: 3000, words: 7 },
        { rank: '10th', name: 'Cryptoholic', score: 2800, words: 6 },
        { rank: '11th', name: 'ExtraPlay1', score: 2600, words: 5 },
        { rank: '12th', name: 'ExtraPlay2', score: 2400, words: 4 },
        { rank: '13th', name: 'ExtraPlay3', score: 2200, words: 3 },
        { rank: '14th', name: 'ExtraPlay4', score: 2000, words: 2 },
        { rank: '15th', name: 'YOU (Me)', score: 1800, words: 1, isMe: true }, // User below top 10
    ];

    // Logic: Show Top 10 + Me (if not in Top 10)
    let displayList = allPlayers.slice(0, 10);
    const myData = allPlayers.find(p => p.isMe);

    if (myData && !displayList.find(p => p.isMe)) {
        displayList.push(myData);
    }

    return (
        <div className="results-screen fade-in">
            {/* Header Section */}
            <div className="results-header">
                <h1 className="game-over-title">GAME OVER</h1>
                <p className="congrats-text">
                    CONGRATS ! YOU FINISHED 1ST, YOUR KNOWLEDGE OF PIGGY IS SUPREME
                </p>

                {/* Action Icons */}
                <div className="result-actions">
                    <button className="icon-btn" onClick={onBackToMenu}>
                        <img src={homeIcon} alt="Home" />
                    </button>
                    <button className="icon-btn" onClick={() => window.location.reload()}>
                        <img src={restartIcon} alt="Restart" />
                    </button>
                    <button className="icon-btn" title="Extend Time">
                        <img src={addIcon} alt="Extend Time" />
                    </button>
                </div>
            </div>

            {/* Main Content: Table Centered */}
            <div className="results-content">
                {/* Leaderboard Table */}
                <div className="leaderboard-container">
                    <div className="table-header">
                        <div className="col rank">Rank</div>
                        <div className="col name">Name</div>
                        <div className="col score">Score</div>
                        <div className="col words">Words Solved</div>
                    </div>

                    <div className="table-body">
                        {displayList.map((player, index) => (
                            <div
                                key={index}
                                className={`table-row ${player.isMe ? 'highlight' : ''}`}
                            >
                                <div className="col rank text-pink">{player.rank}</div>
                                <div className={`col name ${player.isMe ? 'text-pink' : ''}`}>
                                    {player.name}
                                </div>
                                <div className={`col score ${player.isMe ? 'text-pink' : ''}`}>
                                    {player.score}
                                </div>
                                <div className="col words">{player.words}</div>
                            </div>
                        ))}
                    </div>
                </div>
            </div>

            {/* Confetti or Stars effect could be added here via CSS or canvas */}
        </div>
    );
};

export default ResultsScreen;
